"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[382],{83570:e=>{e.exports=JSON.parse('{"functions":[],"properties":[{"name":"city","desc":"Traffic, cars honking, train passing, birds. Echoey reverb like you\'re between buildings.","lua_type":"SoundScript","readonly":true,"source":{"line":42,"path":"src/soundscape/Client/SoundScriptConstants.lua"}},{"name":"bumps","desc":"Random bump noises, echoey reverb. Probably best used as an include for other soundscapes.","lua_type":"SoundScript","readonly":true,"source":{"line":106,"path":"src/soundscape/Client/SoundScriptConstants.lua"}},{"name":"office","desc":"Air conditioning, light machine noise, electric light hums. Occasional bumping noises from importing [SoundScriptConstants.bumps].","lua_type":"SoundScript","readonly":true,"source":{"line":143,"path":"src/soundscape/Client/SoundScriptConstants.lua"}},{"name":"forest","desc":"Subtle wind and birds. Dampened reverb.","lua_type":"SoundScript","readonly":true,"source":{"line":211,"path":"src/soundscape/Client/SoundScriptConstants.lua"}},{"name":"lake","desc":"Subtle wind, birds, water noise. Dampened reverb.","lua_type":"SoundScript","readonly":true,"source":{"line":227,"path":"src/soundscape/Client/SoundScriptConstants.lua"}}],"types":[{"name":"SoundScript","desc":"","lua_type":"{ reverb: Enum.ReverbType, layers: {SoundEntry}, includes: {SoundScript}? }","source":{"line":18,"path":"src/soundscape/Client/SoundScriptConstants.lua"}},{"name":"SoundEntry","desc":"","lua_type":"{ id: string, loop: boolean?, volume: SoundValue, pitch: SoundValue, delay: SoundValue }","source":{"line":23,"path":"src/soundscape/Client/SoundScriptConstants.lua"}},{"name":"SoundValue","desc":"This is a low-level property for a soundscript. These are evaluated each delay a sound is played.\\n\\n* A number in -> The same number out\\n* A two-long number array in -> A random value within the range of the two\\n* A \'nil\' in -> a \'nil\' out, falling back to a default value (i.e. volume = 1)","lua_type":"{ number } | number | nil","source":{"line":33,"path":"src/soundscape/Client/SoundScriptConstants.lua"}}],"name":"SoundScriptConstants","desc":"This modules defines the format of SoundScripts, and a few generic templates that you can use in your own games.\\nSoundScripts in this module are automatically loaded; simply put the name of one (i.e. `city`) in a tagged trigger to use it.\\n\\nIf you create a SoundScript with this system, please consider submitting a PR!\\nThis module is most valuable as a library of soundscapes that can be used in a wide variety of games.\\n\\nFormat inspired by the [Source Engine soundscape system](https://developer.valvesoftware.com/wiki/Soundscape).","realm":["Client"],"source":{"line":13,"path":"src/soundscape/Client/SoundScriptConstants.lua"}}')}}]);